type carouselImg = {
	data: string[];
};

function Carousel(data: carouselImg) {
	return (
		<div id='hero_container'>
			<div id='hero_imgs'>
				<img
					id='carousel_1_img'
					src='https://ca-cdn.runningroom.com/pub/media/catalog/category/m-shoes_banner-S2021.jpg'
				/>
			</div>
			<div id='hero_imgs_paging'></div>
		</div>
	);
}

export default Carousel;
